import './App.scss';

import { routes } from "./routes/Routes";
import { BrowserRouter, Route, Switch } from 'react-router-dom';

import Landing from './pages/Landing/Landing';
import Contact from './pages/Contact/Contact';

function App() {
  return (
    <div className="container">
      <div className="body">
      <BrowserRouter>
        <Switch>
          <Route path="/">
            <Landing />
          </Route>
        </Switch>

        <Switch>
          <Route path="/">
            <Contact />
          </Route>
        </Switch>
      </BrowserRouter>
      </div>
    </div>
  );
}

export default App;
